import React from 'react';
import MapComponent from './MapComponent';
import './styles.css';

function App() {
    return (
        <div className="app">
            <h1>Coastal Erosion Analysis - Sentinel-2 RGB</h1>
            <MapComponent />
        </div>
    );
}

export default App;
